import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

    componentDidMount(){
    const BASE_URL = 'https://api.spotify.com/v1/artists?ids=';
    const ids = '0oSGxfWSnnOXhD2fKuz2Gy,3dBVyJ7JuOMt4GE9607Qin';
    const URL = BASE_URL+ids;

    const access_token ='BQDxA0c59ZPEUzTFkD0iL9XHdZ0Fyfg-CIxGjrv0E2J0IT8k2g59XhLOKWzVX1f8fDgMFAwwpXum0b-t9vBVBHIOUhVzZ8w6wCt1xyrPlhU8ve0a4xfx06brnXYoUVi73qEYKxqyWqwEH1v_r36xbBxAK6EdpI1-pRC5Bjw2Dx2CXL3-KwFjIP-A';

    const myOptions = {
      method: 'GET',
      headers : {
        'Authorization': 'Bearer'+access_token
      },
      mode: 'cors',
      cache: 'default'
    }
    fetch(URL, myOptions)
    .then(res => res.json())
    .then(artists => console.log(artists))
    }

  render() {
    return (
      <div/>
    );
  }
}

export default App;
